INSERT IGNORE INTO `#__qazap_emailtemplates` (`id`, `ordering`, `state`, `mode`, `checked_out`, `checked_out_time`, `name`, `subject`, `body`, `altbody`, `css`, `lang`, `default`, `purpose`, `created_by`, `created_time`, `modified_by`, `modified_time`) VALUES 
(1, 1, 1, 1, 0, '0000-00-00 00:00:00', 'New Vendor', 'A new vendor has registered', '<p>Dear Admin,</p>\r\n<p>A new vendor has registered name : <strong> {{shop_name}}</strong></p>', 'A new vendor registered', '', '*', 1, 'vendor.new', 13, '0000-00-00 00:00:00', 13, '2014-08-28 11:32:30'),
(2, 2, 1, 1, 0, '0000-00-00 00:00:00', 'Vendor Status Changed', '[{{ shop_name }}] status has been updated', '<p>Hi {{shop_name}},</p>\r\n<p> </p>\r\n<p>Your vendor account status has been changed to <strong>{{ state }}</strong></p>\r\n<p> </p>\r\n<p>In case of any queries please contact us directly.</p>', '', '', '*', 1, 'vendor.statuschange', 13, '0000-00-00 00:00:00', 13, '2014-08-28 11:33:51'),
(6, 3, 1, 1, 0, '0000-00-00 00:00:00', 'Vendor Payments', 'You have received a payout', '<p>Payments made to vendor ||:SHOP_NAME:|| Rs ||:PAYMENT_AMOUNT:|| on ||:DATE:||</p>', '', '', '*', 1, 'payment.vendor', 13, '0000-00-00 00:00:00', 13, '2014-05-13 14:52:43'),
(7, 4, 1, 1, 0, '0000-00-00 00:00:00', 'Product Related Query', 'A query received against {{product_name}}', '<p>A query has been arrived against {{product_name}} . </p>\r\n<p> </p>\r\n<blockquote>\r\n<p>{{question}}</p>\r\n</blockquote>', '', '', '*', 1, 'question.product', 13, '2014-04-08 10:40:34', 13, '2014-05-14 10:47:18'),
(8, 5, 1, 1, 0, '0000-00-00 00:00:00', 'Membership Expired', 'Your subscription has expired', '<p><strong>Dear {{name}},</strong></p>\r\n<p>Your subscription of <strong>{{plan_name}}</strong> has got expired today. Please find the present status below. </p>\r\n<div>Plan Name: {{plan_name}}</div>\r\n<div>Start Date: {{from_date}}</div>\r\n<div>End Date: {{to_date}}</div>\r\n<div>Status: {{#status}} <b>Active</b> {{/status}} {{^status}} <b>Expired</b> {{/status}}</div>\r\n<div> </div>\r\n<div> </div>\r\n<div>Please visit our website for more details.</div>\r\n<div> </div>\r\n<div>Thank you.</div>', '', '', '*', 1, 'member.delete', 13, '2014-04-16 13:18:43', 13, '2014-05-21 11:18:51'),
(9, 6, 1, 1, 0, '0000-00-00 00:00:00', 'Membership Activated', 'Your subscription is active', '<p><strong>Dear {{name}},</strong></p>\r\n<p>Your subscription of <strong>{{plan_name}}</strong> has been activated. Please find the present status below. </p>\r\n<div>Plan Name: {{plan_name}}</div>\r\n<div>Start Date: {{from_date}}</div>\r\n<div>End Date: {{to_date}}</div>\r\n<div>Status: {{#status}} <b>Active</b> {{/status}} {{^status}} <b>Expired</b> {{/status}}</div>\r\n<div> </div>\r\n<div> </div>\r\n<div>Please visit our website for more details.</div>\r\n<div> </div>\r\n<div>Thank you.</div>', '', '', '*', 1, 'member.new', 13, '2014-04-16 13:28:10', 13, '2014-05-21 11:17:59'),
(10, 7, 1, 1, 0, '0000-00-00 00:00:00', 'Membership Notification', 'Your subscription is going to expire soon', '<p><strong>Dear {{name}},</strong></p>\r\n<p>Your subscription of <strong>{{plan_name}}</strong> is going to expire on {{<span style=\"line-height: 1.3em;\">to_date</span><span style=\"line-height: 1.3em;\">}} .</span><span style=\"line-height: 1.3em;\">Please find the present status below. </span></p>\r\n<div>Plan Name: {{plan_name}}</div>\r\n<div>Start Date: {{from_date}}</div>\r\n<div>End Date: {{to_date}}</div>\r\n<div>Status: {{#status}} <b>Active</b> {{/status}} {{^status}} <b>Expired</b> {{/status}}</div>\r\n<div> </div>\r\n<div> </div>\r\n<div>Please visit our website for more details.</div>\r\n<div> </div>\r\n<div>Thank you.</div>', '', '', '*', 1, 'member.notify', 13, '2014-04-16 13:32:45', 13, '2014-08-29 11:32:55'),
(11, 9, 1, 1, 0, '0000-00-00 00:00:00', 'Product Notify Email Verification', 'Verify your email address', '<p>Hello</p>\r\n<p>Please click the link to activate your mail id</p>\r\n<p>{{verification_link}}</p>', '', '', '*', 1, 'notify.verification', 13, '2014-04-23 08:19:43', 13, '2014-08-29 11:17:47'),
(12, 10, 1, 1, 0, '0000-00-00 00:00:00', 'Product Notification Email', '{{product_name}} is available now', '<p>We got some good news for your. <strong>{{product_name}}</strong> is available in stock now . You can now place the order for the same.</p>\r\n<p>Please visit our site for more details.</p>', '', '', '*', 1, 'notify.mail', 13, '2014-04-24 08:49:16', 13, '2014-05-21 11:30:19'),
(13, 11, 1, 1, 0, '0000-00-00 00:00:00', 'New Order to Buyer and Admin', 'Order receipt confirmation - Order Ref: {{ordergroup_number}}', '<p><strong>Hi {{ billing_address.first_name }} {{ billing_address.last_name }},</strong></p>\r\n<p>Thank you for your order!</p>\r\n<p>We will update you once the items in your order have been shipped.</p>\r\n<p>Meanwhile, you can check the status of your order on our website.</p>\r\n<div style=\"text-align: right; padding: 3px 0;\"><strong>Order Group Number:</strong> {{ ordergroup_number }}</div>\r\n<div style=\"text-align: right; padding: 3px 0;\"><strong>Date:</strong> <span style=\"line-height: 1.3em;\">{{ created_on }}</span></div>\r\n<div style=\"text-align: right; padding: 3px 0 15px 0;\"><strong>Status:</strong> {{ order_status }} </div>\r\n<table style=\"width: 100%; border: 1px solid #DDD; background: #FFF;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"10\">\r\n<thead>\r\n<tr>\r\n<td style=\"font-size: 14px; font-weight: bold; background: #FAFAFA; border-bottom: 1px solid #DDD; padding-top: 10px; padding-bottom: 10px;\" width=\"50%\"><strong>Billing Address</strong></td>\r\n<td style=\"font-size: 14px; font-weight: bold; background: #FAFAFA; border-bottom: 1px solid #DDD; border-left: 1px solid #DDD; padding-top: 10px; padding-bottom: 10px;\" width=\"50%\"><strong>Shipping Address </strong></td>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\">\r\n<div>{{# billing_address }}</div>\r\n<div>{{ company }}</div>\r\n<div>{{ first_name }} {{ last_name }}</div>\r\n<div>{{ address_1 }}</div>\r\n<div>{{ address_2 }}</div>\r\n<div>{{ city }} {{ zip }} {{ states_territory }}</div>\r\n<div>{{ country }}</div>\r\n<div>Email: {{ email }}</div>\r\n<div>Tel: {{ phone }}</div>\r\n<div>{{/ billing_address }}</div>\r\n</td>\r\n<td style=\"border-left: 1px solid #DDD;\" valign=\"top\">\r\n<div>{{# shipping_address }}</div>\r\n<div>{{ first_name }} {{ last_name }}</div>\r\n<div>{{ address_1 }}</div>\r\n<div>{{ address_2 }}</div>\r\n<div>{{ city }} {{ zip }} {{ states_territory }}</div>\r\n<div>{{ country }}</div>\r\n<div>{{/ shipping_address }}</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align: left;\">  {{{items_table}}}</p>', 'Order Group ID: {{ ordergroup_id }}\r\n\r\nOrder Group Number: {{ ordergroup_number }}\r\n\r\n{{# billing_address }} {{ first_name }} {{/ billing_address }}', 'h1 {font-size: 32px;}\r\n.center {text-align: center;}', '*', 1, 'ordergroup.new', 13, '2014-05-05 13:54:51', 13, '2014-05-21 11:30:19'),
(14, 13, 1, 1, 0, '0000-00-00 00:00:00', 'Invoice to Buyer and Admin', 'Invoice - Order Ref: {{ordergroup_number}}', '<p><strong>Hi {{ billing_address.first_name }} {{ billing_address.last_name }},</strong></p>\r\n<p>Your order status / order items status have been updated! Please find the updated order and detailed invoice below.</p>\r\n<p>You can also check the status of your order on our website.</p>\r\n<p><strong>Comments:</strong></p>\r\n<p>{{ special_comments }}</p>\r\n<h2 style=\"text-align: center;\"><strong>INVOICE</strong></h2>\r\n<div style=\"text-align: right; padding: 3px 0;\"><strong>Order Group Number:</strong> {{ ordergroup_number }}</div>\r\n<div style=\"text-align: right; padding: 3px 0;\"><strong>Date:</strong> <span style=\"line-height: 1.3em;\">{{ created_on }}</span></div>\r\n<div style=\"text-align: right; padding: 3px 0 15px 0;\"><strong>Status:</strong> {{ order_status }} </div>\r\n<table style=\"width: 100%; border: 1px solid #DDD; background: #FFF;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"10\">\r\n<thead>\r\n<tr>\r\n<td style=\"font-size: 14px; font-weight: bold; background: #FAFAFA; border-bottom: 1px solid #DDD; padding-top: 10px; padding-bottom: 10px;\" width=\"50%\"><strong>Billing Address</strong></td>\r\n<td style=\"font-size: 14px; font-weight: bold; background: #FAFAFA; border-bottom: 1px solid #DDD; border-left: 1px solid #DDD; padding-top: 10px; padding-bottom: 10px;\" width=\"50%\"><strong>Shipping Address </strong></td>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\">\r\n<div>{{# billing_address }}</div>\r\n<div>{{ company }}</div>\r\n<div>{{ first_name }} {{ last_name }}</div>\r\n<div>{{ address_1 }}</div>\r\n<div>{{ address_2 }}</div>\r\n<div>{{ city }} {{ zip }} {{ states_territory }}</div>\r\n<div>{{ country }}</div>\r\n<div>Email: {{ email }}</div>\r\n<div>Tel: {{ phone }}</div>\r\n<div>{{/ billing_address }}</div>\r\n</td>\r\n<td style=\"border-left: 1px solid #DDD;\" valign=\"top\">\r\n<div>{{# shipping_address }}</div>\r\n<div>{{ first_name }} {{ last_name }}</div>\r\n<div>{{ address_1 }}</div>\r\n<div>{{ address_2 }}</div>\r\n<div>{{ city }} {{ zip }} {{ states_territory }}</div>\r\n<div>{{ country }}</div>\r\n<div>{{/ shipping_address }}</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>\r\n<div>{{{items_table}}</div>', 'Order Group ID: {{ ordergroup_id }}\r\n\r\nOrder Group Number: {{ ordergroup_number }}\r\n\r\n{{# billing_address }} {{ first_name }} {{/ billing_address }}', 'h1 {font-size: 32px;}\r\n.center {text-align: center;}', '*', 1, 'ordergroup.invoice', 13, '2014-05-14 10:30:04', 13, '2014-05-21 11:30:44'),
(15, 14, 1, 1, 0, '0000-00-00 00:00:00', 'Order Confirmation to Vendor', 'You have just received an order. Order Number: {{ order.order_number }}', '<p><strong>Hi {{ order.shop_name }}</strong><strong style=\"line-height: 1.3em;\">,</strong></p>\r\n<p>Congratulation! You have just received an order. </p>\r\n<p>Please find the order details below. You are requested to arrange to execute the order as soon as possible and update the order status from your seller\'s account area on our website. In case of any doubts please contact us directly. </p>\r\n<div style=\"text-align: right; padding: 3px 0;\"><strong>Order Number:</strong> {{ order.order_number }}</div>\r\n<div style=\"text-align: right; padding: 3px 0;\"><strong>Date:</strong> <span style=\"line-height: 1.3em;\">{{ ordergroup.created_on }}</span></div>\r\n<div style=\"text-align: right; padding: 3px 0 15px 0;\"><strong>Status:</strong> {{ order.order_status }} </div>\r\n<table style=\"width: 100%; border: 1px solid #DDD; background: #FFF;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"10\">\r\n<thead>\r\n<tr>\r\n<td style=\"font-size: 14px; font-weight: bold; background: #FAFAFA; border-bottom: 1px solid #DDD; padding-top: 10px; padding-bottom: 10px;\" width=\"50%\"><strong>Billing Address</strong></td>\r\n<td style=\"font-size: 14px; font-weight: bold; background: #FAFAFA; border-bottom: 1px solid #DDD; border-left: 1px solid #DDD; padding-top: 10px; padding-bottom: 10px;\" width=\"50%\"><strong>Shipping Address </strong></td>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\">\r\n<div>{{#ordergroup}}</div>\r\n<div>{{#billing_address}}</div>\r\n<div>{{company }}</div>\r\n<div>{{first_name}} {{ last_name }}</div>\r\n<div>{{address_1}}</div>\r\n<div>{{address_2}}</div>\r\n<div>{{city}} {{zip}} {{ states_territory }}</div>\r\n<div>{{country}}</div>\r\n<div>Email: {{email}}</div>\r\n<div>Tel: {{phone}}</div>\r\n<div>{{/billing_address}}</div>\r\n<div>{{/ordergroup}}</div>\r\n</td>\r\n<td 