(19, 8, 1, 1, 0, '0000-00-00 00:00:00', 'Membership Update', 'Your subscription has been updated', '<p><strong>Dear {{name}},</strong></p>\r\n<p>Your subscription of <strong>{{plan_name}}</strong> has just been updated. Please find the present status below. </p>\r\n<div>Plan Name: {{plan_name}}</div>\r\n<div>Start Date: {{from_date}}</div>\r\n<div>End Date: {{to_date}}</div>\r\n<div>Status: {{#status}} <b>Active</b> {{/status}} {{^status}} <b>Expired</b> {{/status}}</div>\r\n<div> </div>\r\n<div> </div>\r\n<div>Please visit our website for more details.</div>\r\n<div> </div>\r\n<div>Thank you.</div>', '', '', '*', 1, 'member.update', 13, '2014-05-21 10:18:21', 13, '2014-05-21 11:30:19');
